import React, { Component } from "react";

class Search extends Component {
  constructor(props) {
    super(props);

    this.state = {};
    this.handleSendImg = this.handleSendImg.bind(this);
  }

  handleSendImg = () => {};
  render() {
    return (
      <div>
        <input
          id="IngredientInput"
          type="submit"
          name="Ingredient"
          onChange={(e) => handleSendImg(e)}
          accept=".jpg"
        />
      </div>
    );
  }
}

export default Search;
